export default function List() {
    return (
        <>
            <h2>Está é a minha primeira lista com </h2>
            <ul>
                <li>Este é o 1º componente da lista!</li>
                <li>Este é o 2º componente da lista!</li>
                <li>Este é o 3º componente da lista!</li>
                <li>Este é o 4º componente da lista!</li>
            </ul>
        </>
    );
}
